import React from 'react'
import ReactDOM from 'react-dom'
import Link from 'next/link'



class Footer extends React.Component {
    render() {
        return (
            <div>
                <p>The footer goes at the bottom!</p>
            </div>
        )
    }
}

export default Footer;
